import React from 'react';

const Login = () => {
    return ( 
        <div className='form-usuario'>
            <div className='contenedor-form sombra-dark'>
                <h1>Iniciar Sesion</h1>

                <form>
                    <div className='campo-form'></div>
                </form>
            </div>
        </div>
     );
}
 
export default Login;
